  projects funded under the following Hazard Mitigation Assistance (HMA) grant programs:
  Flood Mitigation Assistance (FMA). The FMA program is authorized by Section 1366
  of the National Flood Insurance Act of 1968, as amended (NFIA), 42 U.S.C. 4104c,
  with the goal of reducing or eliminating claims under the National Flood Insurance
  Program (NFIP). FMA is subject to the availability of appropriations funding, as
  well as any directive or restriction made with respect to such funds.\",\n\t\"license_title\":
